import React, { useState } from 'react'; 

import Login from './Login'; 
import SignUp from './SignUp';
import App from './App'; 


function Navigator() {
    const[page, setPage] = useState('SignUp'); 

    const handleNavigator = (page) => {
        setPage(page);
    }
    return(
        <div> 
            <nav> 
            <button onClick={() => handleNavigator>(SignUp)}>SignUp</button>
            <button onClick={() => handleNavigator>(Login)}>Login</button>
            <button onClick={() => handleNavigator>(App)}>App</button> 

            </nav>
            {page === 'SignUp' && <SignUp />}
            {page === 'Login' && <Login />}
            {page === 'App' && <App /> }
        </div> 
     );
}
export default Navigator;
